import axios from 'axios';
import React, {  useState } from 'react'
import { Link, useNavigate } from 'react-router-dom';

const PostRouteDetails = () => {
    const navigate = useNavigate()

    const [postRouteDetails, setPostRouteDetails] = useState({
        scheduleTime:''
    })

    co

    const changeHandler = (e) => {
        setPostRouteDetails(prev => ({...prev, [e.target.name]: e.target.value }))
    }

    const clickHandler = (e) => {
        e.preventDefault();

        axios.post("http://localhost:8080/admin/route-details/post", postRouteDetails)
            .then(
                response => {
                    navigate('/timeschedule')
                }
            ).catch(
                error => {
                    console.log(error)
                }
            )
    }

    return (
        <div className='stylefrom'>
            <div className='forms' >
                <form>
                    <h3>Add Route Details</h3>
                    <div >
                        <label htmlFor='text'>routeId</label><br></br>
                        <select name='train' id='id' onChange={changeHandler}>
                            <option selected value={''} >select Train Name</option>

                        </select>
                    </div>
                    <div >
                        <label htmlFor='text'>Station Id</label><br></br>
                        <input type={"text"} placeholder="station Id.." name='stationId' value={postRouteDetails.stationId} onChange={changeHandler} required ></input><br></br><br></br>
                    </div>
                    <div >
                        <label htmlFor='text'>Arraival Time</label><br></br>
                        <input type={"text"} placeholder="HH:mm:ss" name='time' value={postRouteDetails.time} onChange={changeHandler} required ></input><br></br><br></br>
                    </div>
                    <div>
                        <button onClick={clickHandler}>-Add-</button><br></br><br />
                    </div>
                    <div>
                        <Link to={"/timeschedule"}> Back</Link>
                    </div>
                </form>
            </div>
        </div>
    )
}


export default PostRouteDetails
